export const projects = [
  {
    name: "ground application ME44 ",
    thumbnail: {
      src: "",
      alt: ""
    },
    description: [
      "ground application ME44 .",
      "My main task in this project is maintaining the website of Comico Thailand. Fixing bugs that are reported by users and the operation team."
    ]
  },
  {
    name: "Return technology",
    thumbnail: {
      src: "",
      alt: ""
    },
    description: [
      "Return technology ",
      "My main task is also maintaining the website of Comico Indonesia. However, since it is cloned from a different project, there are a lot of unused code as well as bugs to remove.",
      "On the other hand, I am also responsible for adding new features to improve the User Experience and make Comico Indonesia distinct from Comico Thailand."
    ]
  },
  {
    name: "Cheer Up KPI",
    thumbnail: {
      src: "https://i.ibb.co/8DZGxkh/cheer-Up-KPI.jpg",
      alt: "cheer-up-kpi"
    },
    description: [
      "Cheer Up KPI is a business application for recruitment agencies. It is used to measure how well companies or individuals are performing.",
      "It has a web version and an Android version. I worked in a team of 3 people to develop the Android version of Cheer Up KPI, using Android Studio."
    ]
  }
];
